int main()
{
    int n,k;
    bool status=false;
    scanf("%d%d",&n,&k);
    for(int i=2;i<=n;i++)
    {
        if(i-k>=2&&prime[i]&&prime[i-k]){
            printf("%d %d\n",i,i-k);
            prime[i]=0;
            status=1;
        }
        if(i+k<=n&&prime[i]&&prime[i+k]){
            printf("%d %d\n",i,i+k);
            prime[i]=0;
            status=1;
        }
    }
    if(!status) printf("empty");
}
